import Card from "./Card"

const Cards = ({courses}) => {
  let allCourses= [];
  const getCourses= ()=>{
    Object.values(courses).forEach(courseCat => {
      courseCat.forEach((course)=>{
        allCourses.push(course);
      });
    });
  }
  
  getCourses();
  return (
    <div className="w-11/12">      
      {
      allCourses.map((course)=><Card course= {course} />
      )
    }
    </div>
  )
}

export default Cards
